import React from 'react'
import styled from 'styled-components';

const Hero = () => {
    return (
        <div>
           <Container>
                <Wrapper>
                    <InnerWrapper>
                        <Left>
                            <h1>Hero </h1>
                        </Left>

                    </InnerWrapper>
                </Wrapper> 

           </Container>
        </div>
    )
}

export default Hero;


const Container = styled.div`
    position: absolute;
    width: 687px;
    height: 877px;
    left: 39px;
    top: 162px;
    align-items: center;
    background: rgba(227, 252, 255, 0.53);
    border-radius: 30px;
    justify-content: space-between;



`;
const Wrapper = styled.div`
    position: absolute;
    width: 549px;
    height: 107px;
    left: 50px;
    top: 20px;

    background: #E6DADA;
    border-radius: 30px;


`;
const InnerWrapper = styled.div`


`;
const Left = styled.div`


`;
